import {ReactComponent as SvgIcon} from '../../assets/images/icon-home.svg';

const data = [
    {
        description: 'Something',
        prefixIcon: 'something',
        suffixIcon: 'Something',
    }
]

export const Menu = ({data}) => {
    return (
        <div className="ct-menu">
            {
                data.map((item) => {
                    return ( 
                    <div className="ct-menu__item">
                    <SvgIcon/>
                    {}
                </div>
                )
                })
            }
        </div>
    );
}
